import React from "react";

const SignUp = () => {
  return (
    <div className="signupform">
      <h1>Sign UP </h1>
      <h5>Name</h5>
      <input type="text" className="inp" />
      <h5>Email</h5>
      <input type="text" className="inp" />
      <h5>Password</h5>
      <input type="Password" className="inp" />
      <button>SignUP</button>
    </div>
  );
};

export default SignUp;
